import { useState } from "react";

function LargeCube({ onFaceClick }) {


  return (
    <mesh rotation={[Math.PI / 6, Math.PI / 4, 0]} >
      <boxGeometry attach="geometry" args={[1.8, 1.8, 1.8]} />
      <meshBasicMaterial attach="material-0" color="#00FF00" />
<meshBasicMaterial attach="material-1" color="#FF0000" />
<meshBasicMaterial attach="material-2" color="#FF0000" />
<meshBasicMaterial attach="material-3" color="#FF0000" />
<meshBasicMaterial attach="material-4" color="#FF0000" />
<meshBasicMaterial attach="material-5" color="#FF0000" />
    </mesh>
  );
}
export default LargeCube;
